import React from 'react';

import './Navbar.scss';

function Navbar() {
    return(
        <div className="navbar">
            <div className="navbar-tab">
                <span>Home</span>
            </div>
            <div className="navbar-tab">
                <span>Search</span>
            </div>
        </div>
    )
}

export default Navbar;
